   * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2859962","type":"CustomJS"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.1},"fill_color":{"field":"inc","transform":{"id":"2859585"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"top":{"field":"Open"},"width":{"value":0.8},"x":{"field":"index"}},"id":"2859853","type":"VBar"},{"attributes":{},"id":"2859560","type":"BasicTicker"},{"attributes":{},"id":"2859653","type":"UnionRenderers"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"2859586"}},"marker":{"value":"triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_long"}},"id":"2859771","type":"Scatter"},{"attributes":{"below":[{"id":"2859599"}],"center":[{"id":"2859602"},{"id":"2859606"},{"id":"2859660"}],"height":110,"left":[{"id":"2859603"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"2859628"},{"id":"2859634"},{"id":"2859644"},{"id":"2859666"},{"id":"2859689"},{"id":"2859714"}],"sizing_mode":"stretch_width","title":{"id":"2859646"},"toolbar":{"id":"2859615"},"toolbar_location":null,"width":null,"x_range":{"id":"2859550"},"x_scale":{"id":"2859595"},"y_range":{"id":"2859593"},"y_scale":{"id":"2859597"}},"id":"2859591","subtype":"Figure","type":"Plot"},{"attributes":{"toolbar":{"id":"2860034"}},"id"
